import React from 'react';
import './App.scss';
import { HashRouter, Routes, Route} from 'react-router-dom';
import Home from './components/Home/Home';

function App() {
  return (
    <div className="App">
      <HashRouter>
        <Routes>
          <Route path='/' element={<Home />}/>
        </Routes>
      </HashRouter>
    </div>
  );
}

export default App;
